import React from "react";

function Config (){
    return(
        <div>
            <label>
              <span>{temaOscuro ? '' : ''}</span>
              <ReactSwitch
                onChange={toggleTema}
                checked={temaOscuro} height={15}
                width={30}
                handleDiameter={15}
                uncheckedIcon={false}
                checkedIcon={false}
                onColor="#cccccc"
                offColor="#333"
                onHandleColor="#fff"
                offHandleColor="#fff" />
            </label>
          </div>
    )

}

export default Config;
